import React from "react";
import { MainLayoutContainer } from "./MainLayout.style.ts";

function MainLayout() {
  return (
    <>
      <MainLayoutContainer>
        <h1>Welcome</h1>
        <h2>I am Ryad Laouedj</h2>
      </MainLayoutContainer>
    </>
  );
}

export default MainLayout;
